sys_variable_value.value:
(function execute(inputs, outputs) {

  var now = new GlideDate();
  var nowFormatted = now.getByFormat("MM/dd/yyyy");
  var nowPlus30 = new GlideDate(now);
  nowPlus30.addDaysLocalTime(30);

  // Have not implemented Eval Plan yet, so cannot determine LPTA vs BVTO yet; hard-coding PALT to 30 for now
  var palt = "30";
  var corEmail = null;
  var corLastName = null;
  var corFirstName = null;
  var corAreaCode = null;
  var corExchange = null;
  var corNumber = null;
  var corExtension = null;
  //var igce = null;
  var estCurrentFyObl = null;
  var igce = new Igce(inputs.acquisition_package.sys_id);   
  var dummyFunding = [
    {
      fundingDocId: "DUMMYFORM9",
      fundingType: "",
      fundingTypeCode: "",
      purchaseRequest: "",
      fundId: 62277,
      fundSeqId: 1,
      fundLineId: 0,
      availableFunds: 0,
      safBaseAmount: 0,
      prNumber: "",
      createdBy: "",
      returnMsg: ""
    }
  ];

  // Find COR Contact Record
  var corContact = null;
  var m2mRecord = new GlideRecord('x_g_dis_atat_m2m_contacts_acquisition');
  m2mRecord.addQuery("acquisition_package", inputs.acquisition_package.sys_id);
  m2mRecord.query();
  while (m2mRecord.next()) {
  	if (m2mRecord.contacts && m2mRecord.contacts.type && "COR" == m2mRecord.contacts.type.toString()) {
      if (m2mRecord.contacts.email) {
        corEmail = m2mRecord.contacts.email.toString();
      }
      if (m2mRecord.contacts.first_name) {
      	corFirstName = m2mRecord.contacts.first_name.toString();
      }
      if (m2mRecord.contacts.last_name) {
      	corLastName = m2mRecord.contacts.last_name.toString();
      }
      if (m2mRecord.contacts.phone_extension) {
      	corExtension = m2mRecord.contacts.phone_extension.toString();
      }      
      if (m2mRecord.contacts.phone) {
        var phone = m2mRecord.contacts.phone.toString();
        if (phone.length == 12) {
          corAreaCode = phone.slice(2, 5);
          corExchange = phone.slice(5, 8);
          corNumber = phone.slice(8, 12);
        }
      }        
      break;
    }
  }  

  outputs.body = JSON.stringify({
    actionablePackageReceivedDate: nowFormatted,
    awardBySept30: "Y",
    awardRisk: "Low",
    createdBy: "ATAT",
    createdByUserId: parseInt(inputs.acquisition_package.primary_reviewer.css_id.toString()),
    description: inputs.acquisition_package.project_overview.scope.toString(),
    dodDoTo: "Y",
    draftPackageReceivedDate: nowFormatted,
    estCurrentFyObl: igce.getEstimatedBaseYearObligation().toString(),
    igce: igce.getEstimatedObligation().toString(),
    lifeCycleAmount: igce.getEstimatedObligation().toString(),
    paltCode: palt,
    piin: inputs.jwcc_contract_number ? inputs.jwcc_contract_number.toString() : "",
    projAwardDate: nowPlus30.getByFormat("MM/dd/yyyy"),
    title: inputs.acquisition_package.project_overview.title.toString(),
    typeAction: "D",
    vehicleCode: "JWCC",
    setAsideForSmallBiz: "NO",
    issuedByAgency: 16,
    issuedByOrg: 378,
    issuedByContSpec: parseInt(inputs.acquisition_package.primary_reviewer.css_id.toString()),
    issuedByKo: parseInt(inputs.acquisition_package.ditco_ko.css_id.toString()),
    issuedByRespOfcCode: "PL85",
    officeCode: "PL85",
    jaInd: "N",
    customerPocType: "CONTORDCUST",
    customerAgency: parseInt(inputs.acquisition_package.organization.agency.css_id.toString()),
    customerEmail: corEmail,
    customerPocLastName: corLastName,
    customerPocFirstName: corFirstName,
    customerAreaCode: corAreaCode,
    customerExch: corExchange, 
    customerNumber: corNumber,
    customerExt: corExtension,
    funding: null
  });
})(inputs, outputs);

